I came across this song today and it brings me to tears. It reminds me of my Marines friend/brother Cpl Rodd who passed away July 30, 2020 during a training exercise when the amphibious vehicle sank with him and 6 other Marines and 1 Sailor still inside. My Marine son called to let me know he was okay, Incase I had heard about the accident. I could hear in his voice that something was wrong. He proceeded to tell me about the accident and that one of his good friends was one of the Marines who went down with the amphibious vehicle. My heart broke for all the families who got that dreaded knock on the door that every military family fears. But it broke my heart even more when my Marine told me Cpl Rodd had a newborn son that will never know his daddy. I wanted to bust out in tears but I knew I had to be strong for my son who was hurting. As a mom you want to take that pain away but you learn being a military mom especially a Marine mom that all you can do is listen and be there for them day or night. There‚Äôs not a day that goes by that my Marine doesn‚Äôt think about his friend, his friends newborn son and the brothers he lost that day. 

